import React from "react";
import "./SearchBar.css";
import InputField from "./InputField";
class SearchBar extends React.Component {
    render() {
        return (
            <div id="searchCont">
                <InputField
                    type="text"
                    width="500px"
                    height={visina}
                    fontSize={font}
                />
                <button
                    style={{ width: "100px", height: "45px", fontSize: "15px", backgroundColor: "#2d2d2d", border:"0px" }}>SEARCH</button>
            </div>

        );
    }
}

export default SearchBar;
